import React from "react";

import { FaFacebook, FaTwitter, FaLinkedin, FaInstagram, FaGoogle} from "react-icons/fa";

export const socialData = [

  {id: 1, icon: <FaFacebook className = "icon"/>, url: "https://www.facebook.com"},

  {id: 2,icon: <FaTwitter className = "icon"/>, url: "https://www.twitter.com"},

  {id: 3, icon: <FaLinkedin className = "icon"/>, url: "https://www.linkedin.com"},

  {id: 4, icon: <FaInstagram className = "icon"/>, url: "https://www.instagram.com"},

  {id: 5, icon: <FaGoogle className = "icon"/>, url: "https://www.google.com"}

];
